measurements.description:
One flower on one arching inflorescence; foliage mottled, 14.5 cm long x 3.0 cm wide;
    dorsal sepal white, veined green, purple suffusion laterally;
    petals light green with green veins, spots suffused brown; synsepal marked same as dorsal;
    pouch light green, veined green, brown-pink suffusion at apex and about staminode;
    staminode horseshoe shaped, light green with green veins centrally; substance light; texture glossy.
    Recognized for seldom seen species.
